import React from "react";
import { isPropertySignature } from "typescript";

function Note(props) {
    function handleClick(event) {
        props.onDelete;
        event.preventDefault();
    }
    return (
        <div className="note">
            <h1>{props.title}</h1>
            <p>{props.content}</p>
            <button onClick={handleClick}>Delete</button>
        </div>
    );
}


export default Note;
